import React, { useState, useEffect } from 'react';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import {
  MessageCircle,
  FileText,
  Brain,
  Calendar,
  LogOut,
  TrendingUp,
  Clock,
  BookOpen,
  Award,
  Settings,
  Bell,
  Search,
  BarChart3,
  Users,
  Zap,
  Sparkles,
  CheckCircle2,
  CalendarDays,
  ArrowUpRight,
  Menu,
  X
} from 'lucide-react';

const Dashboard = () => {
  const { user, logout } = useAuth();
  const navigate = useNavigate();
  const location = useLocation();
  const [isNavOpen, setIsNavOpen] = useState(false);
  const [activeRoute, setActiveRoute] = useState(location.pathname || '/');
  const [stats, setStats] = useState({
    totalDocuments: 0,
    totalChats: 0,
    quizzesGenerated: 0,
    studyPlans: 0
  });
  const [recentActivity, setRecentActivity] = useState([]);
  const [upcomingSessions, setUpcomingSessions] = useState([]);
  const [learningMilestones, setLearningMilestones] = useState([]);
  const [resourceHighlights, setResourceHighlights] = useState([]);
  const [insights, setInsights] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    loadDashboardData();
  }, []);

  useEffect(() => {
    setActiveRoute(location.pathname || '/');
  }, [location.pathname]);

  const loadDashboardData = async () => {
    try {
      setStats({
        totalDocuments: 12,
        totalChats: 45,
        quizzesGenerated: 8,
        studyPlans: 3
      });

      setRecentActivity([
        { id: 1, type: 'chat', title: 'Discussed Machine Learning concepts', time: '2 hours ago', icon: MessageCircle },
        { id: 2, type: 'quiz', title: 'Generated quiz on Data Structures', time: '5 hours ago', icon: Brain },
        { id: 3, type: 'document', title: 'Uploaded "Advanced Algorithms.pdf"', time: '1 day ago', icon: FileText },
        { id: 4, type: 'plan', title: 'Created study plan for Finals', time: '2 days ago', icon: Calendar }
      ]);

      setInsights([
        {
          id: 1,
          title: 'Study streak',
          value: '7 days',
          change: '+2 vs last week',
          icon: Clock,
          accent: 'bg-orange-100 text-orange-600'
        },
        {
          id: 2,
          title: 'Average quiz score',
          value: '82%',
          change: '+5% improvement',
          icon: Brain,
          accent: 'bg-purple-100 text-purple-600'
        },
        {
          id: 3,
          title: 'AI sessions this week',
          value: '12',
          change: 'Up 36% week-over-week',
          icon: MessageCircle,
          accent: 'bg-blue-100 text-blue-600'
        }
      ]);

      setUpcomingSessions([
        {
          id: 1,
          title: 'Review Machine Learning notes',
          description: 'Deep dive into gradient boosting and ensembles',
          when: 'Tomorrow · 09:00 AM',
          category: 'Focus Session'
        },
        {
          id: 2,
          title: 'Quiz retake: Data Structures',
          description: 'Attempt the adaptive quiz to reinforce weak topics',
          when: 'Friday · 04:30 PM',
          category: 'Assessment'
        },
        {
          id: 3,
          title: 'Upload lecture summaries',
          description: 'Digitize week 6 lecture notes for AI enrichment',
          when: 'Saturday · 11:00 AM',
          category: 'Preparation'
        }
      ]);

      setLearningMilestones([
        {
          id: 1,
          title: 'Complete Data Structures summary',
          progress: 68,
          eta: 'Due today',
          icon: BookOpen
        },
        {
          id: 2,
          title: 'Finalize AI research outline',
          progress: 42,
          eta: 'Due in 3 days',
          icon: Brain
        },
        {
          id: 3,
          title: 'Revise calculus flashcards',
          progress: 85,
          eta: 'On track',
          icon: Award
        }
      ]);

      setResourceHighlights([
        {
          id: 1,
          title: 'Algorithms cheat sheet.pdf',
          category: 'Document · 2.4 MB',
          link: '/documents',
          icon: FileText,
          accent: 'text-blue-600'
        },
        {
          id: 2,
          title: 'AI Tutor conversation history',
          category: 'Chat · Last session 2h ago',
          link: '/chat',
          icon: MessageCircle,
          accent: 'text-emerald-600'
        },
        {
          id: 3,
          title: 'Weekly study plan',
          category: 'Planner · Updated yesterday',
          link: '/chat',
          icon: Calendar,
          accent: 'text-indigo-600'
        }
      ]);

      setLoading(false);
    } catch (error) {
      console.error('Failed to load dashboard data:', error);
      setLoading(false);
    }
  };

  const handleChatClick = () => {
